import React from "react";

function MyDeck({ myDeck }) {
    console.log(myDeck)
    return <div className="myDeckCard">
        {myDeck.map((myDeckCard) => {
            return (<div>
                <img src={myDeckCard} alt="empty" />
            </div>)
        })}
    </div>;

}

export default MyDeck;
